import "./App.css";
import Header from "./components/Header/Header";
import Hero from "./components/UI/Hero";
import Exercises from "./components/UI/Exercises";
import Start from "./components/UI/Start";

function App(){
    return(
        <>
            <Header/>
            <Hero/>
            <Exercises/>
            <Start/>
        </>
    );
};

export default App;
